Сервисная компания UkrClean осуществляет все виды клинингового обслуживания жилой и коммерческой недвижимости:
- ежедневная комплексная уборка офисов, бизнес-центров, банков, торгово-развлекательных центров, производственных помещений;
- эко уборка;
- генеральная и послестроительная уборка;
- мытье окон, фасадов, промышленный альпинизм;
- химчистка мягкой мебели
- химчистка напольных покрытий всех видов;
- дезинсекция, дезинфекция, дератизация;
- услуги грузчиков и разнорабочих;
- поставка хозяйственных товаров, туалетной бумаги, полотенец бумажных, мыла жидкого, средств гигиены

Все работы выполняются с применением профессионального оборудования и моющих средств.
Возможна любая форма расчета.
Работаем по всей Украине.

тел. 048-735-04-00
моб/вайбер  633 - Показать номер - 
Инстаграм: #ukrclean

Наше предприятие занимается металлообработкой, изготовлением деталей на заказ, выполняет разнообразные операции по токарной обработке поверхностей вращения (валов, вал-шестерней, зубчатых колес, барабанов, шкивов, муфт, фланцев, втулок, шнеков, шайб, осей, гаек, заготовок шестеренок и звездочек):

- обработка наружных конических поверхностей;

- подрезание торцов, обработка уступов;

- вытачивание пазов и канавок, отрезка заготовки;

- обработка внутренних цилиндрических и конических поверхностей;

- сверление, зенкерование и развертывание отверстий;

- нарезание наружной и внутренней резьбы;

- обработка фасонных поверхностей;

- обработка галтелей;

- накатывание рифлений.

Оборудование с программным управлением (ЧПУ) позволяет нам обрабатывать детали с высокой точностью и низкой себестоимостью. Если Вы заинтересованы в размещении заказа на нашем предприятии, Вы можете связаться с нами
 по телефону 
+ 380 - Показать номер - 
либо отправить заявку по электронной почте tehnoprom.zakСОБАКАgmail.com

Бригада опытных, крепких и аккуратных ребят, быстро и качественно выполнят все физические и подсобные работы:
-квартирные\офисные переезды;
-погрузка\разгрузка;
-подъем строй материалов и любых грузов;
-вынос строй мусора;
-услуги грузчиков на время;

